Both path_nodes and announce_list are arrays of limited size. But the way they are updated are different. When path_nodes is full, adding a new element replaces an old one in a circular manner: first adding an element replaces path_nodes[0] , then path_nodes[1] , and so on til we get to the end of the array. After that, we begin again with path_nodes[0] . announce_list is different. It is sorted by distance to real our public key. When an element is added, it is checked against the farest node. If the element is closer to us than the node, the node is removed and the element is inserted. Otherwise, the element is simply discarded. Some packet data structures: struct DhtPkData { no_replay: u64, dht_pk: PublicKey, nodes: Vec<PackedNode>,
} layout DhtPkData { u8 = ONION_DATA_DHTPK, u64, [u8; PUBLIC_KEY_SIZE], [[u8; PACKED_NODE_SIZE]; 0..MAX_SENT_NODES]
}
